import React from 'react'
import { useState } from 'react'
const Cond =()=> {
   const [items,setItems]=useState(
    [
    {
      id:1,
      checked : true,
      item : "read"
    },
    {
      id:1,
      checked : true,
      item : "play chess"
    },
    {
      id:1,
      checked : true,
      item : "run"
    }] )
  return (
   <main>
    <ul>
             {items.map((item)=>(
               <li>
                <input
                type="checkbox"
                checked ={item.checked}
                  />
                  <label >{item.item}</label>
                  <button>Delete</button>
               </li>
             ))}
    </ul>
   </main>
  )
}

export default Cond
